import React, {useState, useEffect} from 'react';
import { BASEURL } from '../lib/baseurl';


export const Profesional = ({ profesional }) => {



    useEffect(() => {
        const [imagen, setImagen] = useState('');
        if(profesional.imagen){
            setImagen(profesional.imagen);
        }else{
            if(profesional.genero === 'Masculino'){            
                setImagen(BASEURL + '/wp-content/plugins/profesionales/doc_m.png');
            }else{
                setImagen(BASEURL + '/wp-content/plugins/profesionales/doc_f.png');
            }
        }
    }, [])

    return (
        <div className="card">
            <div className="card-body">
                <img src={imagen} alt="" className="img-fluid" />
                <h5 className="card-title"> {profesional.apellido}, {profesional.nombre}</h5>
                <p className="card-text">Matricula: {profesional.matricula}</p>
            </div>
        </div>
    );
};
